import React from "react";

const Nominations = (props) => {

  return (
    <div>
        {props.movies.map(movie => {
          return <ul><li>{movie.Title} ({movie.Year})</li>

          <button onClick={() => props.handleFavorites(movie)}> Remove </button>

          </ul>
        })}
    </div>
  );
};

export default Nominations;
